How to optimize a query performance by re-reordering populate, sort, and limit<p>Optimization needed for my Heroku app database queries: The MongoDB hosted by Mongolab contains 2 million documents (3,5 GB and increasing), now this single query takes 2,3 secs to complete on average and Heroku returns timeouts after 200 concurrent users are using the app.  </p>

<p>How to optimize this query? Is the order of populate, sort and limit affecting to the performance, can these be ordered differently? The output should be same if limit 100 happens before populate, how can it be done in this code?  </p>

<p>Mongolab says that the existing indexes are ok, so is there something to do for the code itself?</p>

<pre><code>  findcustomermydataResults = async (
    league: ILeague,
    user: IUser,
    minwp: number,
    maxwp: number
  ): Promise&lt;ImydataResult[]&gt; =&gt; {
    try {
      const mydataResultsInRange = await mydataresult.find(
        {
          league: league._id,
          wp: { $gte: minwp, $lte: maxwp },
          user: { $ne: user._id },
        },
        { user: 1, id: 1, wp: 1, mydata: 1, time: 1, createdAt: 1 }
      )
        .populate({
          path: "user",
          select: ["displayName", "country", "cargo", "customId", "chea"],
        })
        .sort({ createdAt: -1 })
        .limit(100);
      this.debug(
        `findcustomermydataResults() - found: ${
          mydataResultsInRange.length
        } mydata results`
      );
      return mydataResultsInRange;
    } catch (err) {
      this.error(`findcustomermydataResults() - try catch error: ${err}`);
      return null;
    }
</code></pre>

