Show added posts without refreshing page in React<p>I have been working on a personal project outside university, developing a blog.
Right now I'm trying to implement a "home page" where after a succesfull login, the user can post text, and right after that it appears under the Create post div you can see in the pic
This is what I have managed to accomplish so far:</p>

<p><a href="https://i.stack.imgur.com/cEBqq.png" rel="nofollow noreferrer">This is the home page after login</a></p>

<p>Right now I can login, and post a new post which saves it in the database.</p>

<p>This is the home.js functional componenet which the user sees after a login:</p>

<pre><code>import '../App.css';    
import { useHistory } from "react-router-dom";
import React , {useState, useEffect} from 'react';
import jwt_decode from 'jwt-decode'
import logo from '../images/home-logo.png';
import {Col,Form,Input,Button,Card,CardTitle,Navbar,Nav,NavbarBrand} from 'reactstrap'
import { createPost,getUserPosts } from '../fucntions/user_functions'
function Home(){
    var _decoded;
    var _email;
    let history = useHistory();
    const[post_text,setPost] = useState('');

    const handleChangePost = e =&gt;{ setPost(e.target.value);};


    function handlePost(e){
      e.preventDefault();
      const toPost = {
        post :post_text, email :_email
      }
      createPost(toPost).then(res =&gt;{
        setPost('')
      })
    }

    function getPosts() {
      const container ={
        email:_email
      }
      getUserPosts(container).then(res=&gt;{

      })
    }



    function handleLogout (e) {
        e.preventDefault();
        localStorage.removeItem('usertoken')  
        history.push(`/login`)
    }
    useEffect(() =&gt;{
        if (localStorage.getItem("usertoken") === null) {
            history.push('/login')
        } else {
        const token = localStorage.usertoken
        const user_email = localStorage.useremail
        const decoded = jwt_decode(token)
        _decoded = decoded;
        _email = decoded.email
        getPosts()

    };
});
    return (
      &lt;div className = "box"&gt;
        &lt;div&gt;
        &lt;Navbar color="light" light expand="md"&gt;
                    &lt;Nav&gt;
                        &lt;NavbarBrand type = "button" onClick = {handleLogout}&gt;Logout&lt;/NavbarBrand&gt;
                    &lt;/Nav&gt;
        &lt;/Navbar&gt;
        &lt;div className = "wrapper"&gt;
           &lt;Card body outline color="secondary" className = "card-home " &gt;
            &lt;CardTitle&gt;&lt;img src={logo} alt="logo"&gt;&lt;/img&gt;Create post&lt;/CardTitle&gt;
            &lt;Form onSubmit = {handlePost}&gt;
            &lt;Input  id = "tx" name = "input1" type = "textarea" value = {post_text} placeholder="Enter your post here"  onChange= {handleChangePost}&gt;&lt;/Input&gt;
             &lt;br&gt;&lt;/br&gt;
            &lt;Col sm={{ span: 10, offset: 5 }}&gt;
              &lt;Button outline color="primary" type="submit"&gt;Post!&lt;/Button&gt;
            &lt;/Col&gt;
            &lt;/Form&gt;
           &lt;/Card&gt;
          &lt;/div&gt;
      &lt;/div&gt;

    &lt;/div&gt;

    )

}

export default Home;
</code></pre>

<p>I have implemented a getPosts method in the backend which gives back an array of the posts</p>

<pre><code>  router.post("/getPosts",
  async (req, res) =&gt; {
      const {email,} = req.body;
          try {
              let user = await User.findOne({email:email});
              allPosts = user.posts
             res.render('/home',{posts : hello})
        } catch (e) {
            console.error(e);
            res.json("Error")
      }
    }
);
</code></pre>

<p>As you can see above, in the function getPosts(), the response is an Array of all the post's ids the user has posted, they are stored in the mongodb collection called "posts"
And after calling that function, I can iterate over them:</p>

<pre><code>function getPosts() {
  const container ={
    email:_email
  }
  getUserPosts(container).then(res=&gt;{
    forEach(res.posts) {

    }
  })
}
</code></pre>

<p>I want to render all those posts live, so each time the user posts a new post, it will show right after the Create post div you can see in the picture, What's the best way?
Thanks</p>

