<p><strong>User Collection</strong></p>

<pre><code>{
    _id : user1,
    questionId : 100,
    mail: "abc@gmail.com"
},

{
    _id : user2,
    questionId : 400,
    mail: "xyz@gmail.com"
}
</code></pre>

<p><strong>Answer Collection</strong></p>

<pre><code>{ _id: 1,   userId : user1, answer1: "ok",  answer2: "bad",     answer3: "great"},
{ _id: 2,   userId : user1, answer1: "ok",  answer2: "ok",      answer3: "bad"  },
{ _id: 3,   userId : user2, answer1: "ok",  answer2: "Not good",answer3: "great"},
{ _id: 4,   userId : user2, answer1: "ok",  answer2: "bad",     answer3: "great"},
{ _id: 5,   userId : user2, answer1: "ok",  answer2: "bad",     answer3: "bad"  }
</code></pre>

<p>The answer fields answer1,answer2 and answr3 can have either different or same values. Based on the values I have to count the answer and take the percentage among those 3 answers.</p>

<p><strong>Expected Result</strong></p>

<pre><code>[{
    _id:1,
    userId : user1,
    mail: "abc@gmail.com",
    ans:[
        {answer1 :[{"ok":2, percentage:100}]},
        {answer2 :[{"bad":1, percentage: 50},{"ok":1,percentage: 50}]},
        {answer3 :[{"great":1, percentage: 50},{"bad":1,percentage: 50}]}
    ]
},

{
    _id:1,
    userId : user2,
    mail: "xyz@gmail.com",
    ans:[
        {answer1 :[{"ok":3, percentage:100}]},
        {answer2 :[{"Not good":1, percentage: 33},{"bad":2,percentage: 66}]},
