    $lookup: {
        from: 'answer',
        localField: '_id',
        foreignField: 'userId',
        as: 'join'
    }
}, {
    $unwind: {
        path: '$join',
        preserveNullAndEmptyArrays: true
    }
}, {
    $group: {
        _id: '$_id',
        answers: {
            $push: {
                A1: {
                    ans: "$join.answer1"
                },
                A2: {
                    ans: "$join.answer2"
                },
                A3: {
                    ans: "$join.answer3"
                }
            }
        }
    }
}, {
    $unwind: {
        path: '$answers',
        preserveNullAndEmptyArrays: true
    }
}, {
    $group: {
        _id: {
            _id: '$_id',
            Q1: '$answers.Q1.ans'
        },
        count: {
            $sum: 1
        }

    }
}
///...
}]
</code></pre>

<p>I have no idea how to continue</p>

