MongoDB using $cond with Update ($inc)<p>Is there any way to use $cond along with ($set, $inc, ...) operators in update? (MongoDB 4.2) 
I want to update a field in my document by $inc it with "myDataInt" if a condition comes true, otherwise keeps it as it is:</p>

<pre><code>db.mycoll.update(
    {"_id" : "5e9e5da03da783817d231dc4"},
    {"$inc" : {
       "my_data_sum" : {
           "$cond" : [
               {
                  "$ne" : ["snapshot_time", new_snapshot_time)]
               },myDataInt, 0]
           ]
       }
    },
    {upsert=True, multi=False}
)
</code></pre>

<p>However, this gives an error in pymongo:</p>

<pre><code>raise WriteError(error.get("errmsg"), error.get("code"), error)
pymongo.errors.WriteError: The dollar ($) prefixed field '$cond' in 'my_data_sum.$cond' is not valid for storage.
</code></pre>

<p>Any idea to avoid using find() before update in this case?</p>

<p><br>
<strong>Update:</strong></p>

